function calc() {
	var temperature = JSON.parse(dataString);
	
	let room_temperature = +document.getElementById('room-temperature').value;
	let min_input_temperature = +document.getElementById('min-input-temperature').value;
	let output_temperature = +document.getElementById('output-temperature').value;
	let volume = +document.getElementById('volume').value;
	let recuperator_efficiency = +document.getElementById('recuperator-efficiency').value / 100;
	let price = +document.getElementById('energy-price').value;

	
	let totalConsumption = 0;
	let totalConsumptionWithoutRecupirator = 0;
	let minDate = new Date();
	let maxDate = new Date('01.01.2001');
	
	temperature.data.forEach(t => {
		var dateTime = new Date(t.time_local);
		var hours = dateTime.getHours();
		
		if (dateTime < minDate)
			minDate = dateTime;
		
		if (dateTime > maxDate)
			maxDate = dateTime;
		
		if (t.temperature >= output_temperature)
			return;
		
		let temperature = t.temperature;
		totalConsumptionWithoutRecupirator += getHeatingConsumption(volume, temperature, output_temperature);
		let hourConsumption = 0;
		if (temperature < min_input_temperature) {
			hourConsumption += getHeatingConsumption(volume, temperature, min_input_temperature);
			temperature = min_input_temperature;
		}
		
		temperature = recupirate(recuperator_efficiency, room_temperature, temperature);
		
		if (temperature >= output_temperature) {
			totalConsumption += hourConsumption;
			return;
		}
		
		hourConsumption += getHeatingConsumption(volume, temperature, output_temperature);
		totalConsumption += hourConsumption;
	});
	
	
	let cell_consumption_without_recuperator = document.getElementById('consumption-without-recuperator');
	let cell_consumption_with_recuperator = document.getElementById('consumption-with-recuperator');
	let calculation_period = document.getElementById('calculation-period');
	let cost_without_recuperator = document.getElementById('cost-without-recuperator');
	let cost_with_recuperator = document.getElementById('cost-with-recuperator');
	
	//let  = document.getElementById('');
	
	cell_consumption_without_recuperator.textContent = totalConsumptionWithoutRecupirator.toFixed(2);
	cell_consumption_with_recuperator.textContent = totalConsumption.toFixed(2);
	calculation_period.textContent = 'Period from ' + minDate.toLocaleString("RU-ru") + ' to ' + maxDate.toLocaleString("RU-ru"); 
	
	cost_without_recuperator.textContent = (totalConsumptionWithoutRecupirator * price).toFixed(2);
	cost_with_recuperator.textContent = (totalConsumption * price).toFixed(2);
}

function getHeatingConsumption(volume, from, to) {
	if (from >= to)
		return 0;
	
	let d = volume*(353/(273.15+from))/3600000*1009*(to-from);

	return +d.toFixed(3);
}

function recupirate(k, t_room, t_out) {
	let result = (k * (t_room - t_out)) + t_out;
	return +result.toFixed(3);
}